""" **LOWER**"""

lower_data=selected_data.loc[data["Social Class"]== "lower"]
lower_data.head()

selected_columns = ['sqft_living','bedrooms', 'bathrooms', 'floors']
lower_data = lower_data[selected_columns]
transactions = lower_data.values.tolist()
# Transformando os dados em um formato adequado
te = TransactionEncoder()
te_ary = te.fit(transactions).transform(transactions)
df = pd.DataFrame(te_ary, columns=te.columns_)

# Aplicando o algoritmo Apriori
frequent_itemsets = apriori(df, min_support=0.7, use_colnames=True)


# Gerando regras de associa√ß√£o
rules = association_rules(frequent_itemsets, metric="confidence", min_threshold=0.5)


table = PrettyTable()
table.field_names = ["Regra", "Antecedentes", "Consequentes", "Suporte", "Confian√ßa", "Lift"]


# Exibindo as regras de associa√ß√£o
for index, row in rules.iterrows():
    antecedents = ', '.join([str(item) for item in row['antecedents']])
    consequents = ', '.join([str(item) for item in row['consequents']])
    support = round(row['support'], 6)
    confidence = round(row['confidence'], 6)
    lift = round(row['lift'], 6)

    table.add_row([index, antecedents, consequents, support, confidence, lift])




# Exibindo a tabela
print(table)

